Next, we need to set up a motor to power our lift. This is easy to do using the MotorEx class . Let's start by creating a variable to store our motor. It should be of type MotorEx. Note that we aren't setting the value immediately; this is because we don't have access to the hardware map until an OpMode is initialized. public MotorEx motor; We also need a Controller, since we want to move our motor. Let's use a PID controller. I recommend using a P value of 0.005 to start, and leaving I and D at zero. You should come back and tune it later, though. public PIDController controller = new PIDController(new PIDCoefficients(0.005, 0.0, 0.0)); Next, we need a name. This is the name specified in the hardwareMap, so that NextFTC can find the motor. I called mine lift_motor, so that's the name I'm using. Use whatever name you've set in your configuration: public String name = "lift_motor"; Finally, the last step to setting up a motor is instantiating the motor in the initialize() function. Let's do that now: @Override
public void initialize() { motor = new MotorEx(name);
} That's all you need to do to create a motor in NextFTC! To recap: Every motor needs to be stored in a variable Every motor needs a Controller Every motor needs a name Every motor must be instantiated in the initialize function. We're not quite done, though. We still need to create our first commands!

