The last step when you create a Subsystem is to create the commands you'll be using. This process varies with each subsystem. Here, I'll walk you through creating three commands that each move the lift to a different height: toLow, toMiddle, and toHigh. tip It's recommended to create a variable to store each encoder position. However, that takes up more space, so I won't be doing that here. To control our motor, we will be using the RunToPosition command. In Java, the best way to create commands is by making functions that return instances of command classes. Let's create our first RunToPosition command: public Command toLow() { return new RunToPosition(motor, // MOTOR TO MOVE 0.0, // TARGET POSITION, IN TICKS controller, // CONTROLLER TO IMPLEMENT this); // IMPLEMENTED SUBSYSTEM
} Note the last parameter: subsystem. This is what tells NextFTC which commands should be allowed to run at the same time. If it weren't set, toLow would be able to run at the same time as other commands that use the Lift subsystem -- so there would be multiple things fighting to set the motor's power. Generally, you just need to pass this as the subsystem -- there are exceptions with more complicated custom commands. Pretty easy, right? Let's duplicate it and update our function name and target position to create our other two commands: public Command toMiddle() { return new RunToPosition(motor, // MOTOR TO MOVE 500.0, // TARGET POSITION, IN TICKS controller, // CONTROLLER TO IMPLEMENT this); // IMPLEMENTED SUBSYSTEM
} public Command toHigh() { return new RunToPosition(motor, // MOTOR TO MOVE 1200.0, // TARGET POSITION, IN TICKS controller, // CONTROLLER TO IMPLEMENT this); // IMPLEMENTED SUBSYSTEM
}

