Now, since we're using a servo, instead of a motor, let's create a servo variable. Just like our motor variable from the lift subystem, we can't initialize it right away. Currently, there is no wrapper class for Servos, so you will be using the Qualcomm servo class. public Servo servo; Just like our motors, we also need a name for our servo. This is the name specified in the hardwareMap. I called mine claw_servo: public String name = "claw_servo"; Finally, we need to initialize our servo in the initialize() function. Because there is no wrapper class, you will need to access the hardwareMap yourself. The easiest way to do this is by using OpModeData.INSTANCE.getHardwareMap(). NextFTC will automatically give you the active hardwareMap from your running OpMode (as long as you extend NextFTCOpMode or PedroOpMode): @Override
public void initialize() { servo = OpModeData.INSTANCE.getHardwareMap().get(Servo.class, name);
} To recap how you create servo-based Subsystems in NextFTC: Create a variable to store your Servo instance Create a variable to store the name In initialize(), get the Servo instance from the hardwareMap using your name variable.

