OpModes in NextFTC will extend one of two classes: NextFTCOpMode and PedroOpMode, depending on if you're using PedroPathing. This example will use NextFTCOpMode. Refer to the PedroPathing page to learn how to convert a NextFTCOpMode to a PedroOpMode and incorporate PedroPathing. That being said, here is the basic structure for every Autonomous OpMode: @Autonomous(name = "NextFTC Autonomous Program Java")
public class AutonomousProgram extends NextFTCOpMode { } That's not all, though. We want our autonomous program to use the Lift and Claw subsystems we created in the subsystems guide . To do that, we need to add them into the constructor of NextFTCOpMode. We will create a constructor for the AutonomousProgram class, in which we can call the super constructor with our subsystems: public AutonomousProgram() { super(Claw.INSTANCE, Lift.INSTANCE);
} This will tell NextFTC that we will be using those subystems in this OpMode, and will initialize them accordingly.

