You've already learned how to create individual commands, such as motor and servo movements. Now, it's time to group them together into useful behaviors. This is where CommandGroups and routines come into play. Before we can create our own, we first need to understand how commands are run behind the scenes. The CommandManager stores an internal list of actively running commands. It goes through each command and calls its update() function every single loop. It also determines which commands to cancel, handles subsystem conflicts, and offers additional functionality as well. The important thing to note is that all commands that are directly stored by the CommandManager run simultaneously . Knowing that, you may be wondering why ParallelGroups exist, if you can just schedule commands directly. Trust me, we'll get there. Before that, we need to understand what a SequentialGroup does. A SequentialGroup stores a collection of commands and runs them in a row . Instead of scheduling all of its children at once, it schedules the first one, and then waits to schedule the next one until the first has completed, then continues scheduling them one by one until they've all completed. If you think about it a little bit, it may become apparent what a ParallelGroup is for. If you are using a SequentialGroup, you may have things you want to happen simultaneously within that group. For example: Drive to a location Simultaneously raise a lift and rotate an arm Open a claw Simultaneously lower the lift, reset the arm, and drive to a different location This could only be accomplished using ParallelGroups in conjunction with SequentialGroups. Now that we know what CommandGroups do, let's learn how to create them. For this example, we will create a routine that does the following: Raise the lift to the high position Simultaneously open the claw and move the lift to the middle position Wait for half a second Simultaneously close the claw and move the lift to the low position This routine is unlikely to actually be useful in an autonomous program, but it will introduce you to the mental processes behind creating commands, and will give you the tools you need to create your own. Let's go ahead and create our command function. public Command firstRoutine() { return new SequentialGroup();
} I've made an empty SequentialGroup here, for demonstration purposes. caution Do not attempt to use empty SequentialGroups in your code. They will cause errors that break your OpMode. If you need a placeholder, use a NullCommand. The above snippet is incomplete and that's why it appears to create an empty SequentialGroup. That won't work in practice. As mentioned above, we need to put something in our sequential group in order to avoid errors. In our list, we said the first thing we want to do is raise the lift to the high position. We can add the Lift.toHigh command into our group very easily: public Command firstRoutine() { return new SequentialGroup( Lift.INSTANCE.toHigh() );
} The next thing we wanted to do is simultaneously open the claw and move the lift to the middle position. To add another command to the group, add a comma at the end of your last item (in this case, Lift.INSTANCE.toHigh()) and add the next command on a new line (before the close parenthesis). In this case, we want to add a ParallelGroup because we want to do things simultaneously next. public Command firstRoutine() { return new SequentialGroup( Lift.INSTANCE.toHigh(), new ParallelGroup() );
} Just like with SequentialGroups, you shouldn't create empty ParallelGroups (although it won't cause an error like ParallelGroups do). Let's populate it with our Lift.INSTANCE.toMiddle() and Claw.INSTANCE.close() commands: public Command firstRoutine() { return new SequentialGroup( Lift.INSTANCE.toHigh(), new ParallelGroup( Lift.INSTANCE.toMiddle(), Claw.INSTANCE.close() ) );
} Since command groups are also just commands, we can just continue to add commands after the ParallelGroup. Let's wait for half a second using a Delay command. That takes a single value, the amount of time to delay in seconds. important Delays should (almost) always be inside of SequentialGroups. A delay used inside a ParallelGroup will usually accomplish nothing. An exception to this is if you want a ParallelGroup to take a minimum amount of time, then you can put a delay in it as well. Let's create our delay: public Command firstRoutine() { return new SequentialGroup( Lift.INSTANCE.toHigh(), new ParallelGroup( Lift.INSTANCE.toMiddle(), Claw.INSTANCE.close() ), new Delay(0.5) );
} Finally, we can add our last ParallelGroup to our routine. The final routine looks like this: public Command firstRoutine() { return new SequentialGroup( Lift.INSTANCE.toHigh(), new ParallelGroup( Lift.INSTANCE.toMiddle(), Claw.INSTANCE.close() ), new Delay(0.5), new ParallelGroup( Claw.INSTANCE.open(), Lift.INSTANCE.toLow() ) );
}

